{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"provenance":[],"authorship_tag":"ABX9TyNJ8uMr1lw9IPQyI4TD76CK"},"kernelspec":{"name":"python3","display_name":"Python 3"},"language_info":{"name":"python"}},"cells":[{"cell_type":"code","execution_count":1,"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":931},"id":"28TjlTogrp6l","executionInfo":{"status":"ok","timestamp":1761097727746,"user_tz":-120,"elapsed":7545,"user":{"displayName":"Victor Eduardo Martinez Garcia","userId":"01891020272803705193"}},"outputId":"5fa3b9ff-73f3-45c1-c4ad-ba81e7017189"},"outputs":[{"output_type":"display_data","data":{"text/plain":["<Figure size 1200x500 with 2 Axes>"],"image/png":"\n"},"metadata":{}},{"output_type":"display_data","data":{"text/plain":["<Figure size 600x500 with 1 Axes>"],"image/png":"\n"},"metadata":{}}],"source":["import numpy as np\n","import matplotlib.pyplot as plt\n","import seaborn as sns\n","\n","# Energas de muestra en nanoelectronvolts (neV)\n","epsilon = np.array([1.0, 1.5, 2.0]) * 1e-9  # en eV\n","\n","# Log-posterior adaptado a bajas temperaturas\n","def log_posterior(T, mu):\n","    if T <= 0 or mu >= min(epsilon):\n","        return -np.inf\n","\n","    z = (epsilon - mu) / T\n","    if np.any(z <= 0):\n","        return -np.inf\n","\n","    try:\n","        log_likelihood = -np.sum(np.log(np.exp(z) - 1))\n","    except FloatingPointError:\n","        return -np.inf\n","\n","    log_prior_T = -T * 1e9  # Escala ajustada para bajas T\n","    return log_likelihood + log_prior_T\n","\n","# Gradiente numrico del log-posterior\n","def grad_log_posterior(T, mu, h=1e-12):\n","    dT = (log_posterior(T + h, mu) - log_posterior(T - h, mu)) / (2 * h)\n","    dmu = (log_posterior(T, mu + h) - log_posterior(T, mu - h)) / (2 * h)\n","    return np.array([dT, dmu])\n","\n","# HMC adaptado para bajas energas\n","def hmc_sampler(n_samples=1000, epsilon_step=1e-12, L=20):\n","    current_pos = np.array([1.5e-9, 0.5e-9])  # T, mu iniciales\n","    samples = []\n","\n","    for _ in range(n_samples):\n","        momentum = np.random.normal(0, 1, size=2)\n","        current_momentum = momentum.copy()\n","        pos = current_pos.copy()\n","\n","        # Leapfrog\n","        grad = grad_log_posterior(pos[0], pos[1])\n","        momentum -= 0.5 * epsilon_step * grad\n","\n","        for _ in range(L):\n","            pos += epsilon_step * momentum\n","            if np.any(np.isnan(pos)) or pos[0] <= 0 or pos[1] >= min(epsilon):\n","                break\n","            grad = grad_log_posterior(pos[0], pos[1])\n","            if np.any(np.isnan(grad)):\n","                break\n","            momentum -= epsilon_step * grad\n","\n","        grad = grad_log_posterior(pos[0], pos[1])\n","        momentum -= 0.5 * epsilon_step * grad\n","\n","        # Hamiltonianos\n","        logp_current = log_posterior(current_pos[0], current_pos[1])\n","        logp_proposed = log_posterior(pos[0], pos[1])\n","\n","        current_H = -logp_current + 0.5 * np.sum(current_momentum**2)\n","        proposed_H = -logp_proposed + 0.5 * np.sum(momentum**2)\n","\n","        alpha = np.exp(current_H - proposed_H)\n","        if np.random.uniform() < alpha:\n","            current_pos = pos\n","\n","        samples.append(current_pos.copy())\n","\n","    return np.array(samples)\n","\n","# Ejecutar muestreo\n","samples = hmc_sampler()\n","samples = samples[np.isfinite(samples).all(axis=1)]\n","\n","# Grficas\n","plt.figure(figsize=(12, 5))\n","\n","plt.subplot(1, 2, 1)\n","sns.histplot(samples[:, 0] * 1e9, bins=50, kde=True, color='steelblue')\n","plt.title(\"Distribucin posterior de T (n eV)\")\n","plt.xlabel(\"Temperatura T (neV)\")\n","plt.ylabel(\"Frecuencia\")\n","\n","plt.subplot(1, 2, 2)\n","sns.histplot(samples[:, 1] * 1e9, bins=50, kde=True, color='darkorange')\n","plt.title(\"Distribucin posterior de  (n eV)\")\n","plt.xlabel(\"Potencial qumico  (neV)\")\n","plt.ylabel(\"Frecuencia\")\n","\n","plt.tight_layout()\n","plt.show()\n","\n","# Densidad conjunta T vs \n","plt.figure(figsize=(6, 5))\n","sns.kdeplot(x=samples[:, 0] * 1e9, y=samples[:, 1] * 1e9, fill=True, cmap=\"viridis\", levels=50, thresh=0.01)\n","plt.title(\"Densidad conjunta posterior: T vs  (neV)\")\n","plt.xlabel(\"Temperatura T (neV)\")\n","plt.ylabel(\"Potencial qumico  (neV)\")\n","plt.show()"]},{"cell_type":"code","source":["!pip install emcee"],"metadata":{"colab":{"base_uri":"https://localhost:8080/"},"id":"SEKxs66Tr8BO","executionInfo":{"status":"ok","timestamp":1750110058586,"user_tz":360,"elapsed":5021,"user":{"displayName":"Victor Eduardo Martinez Garcia","userId":"01891020272803705193"}},"outputId":"c579c318-ff33-48ff-b3e6-ed541fa0d2d7"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stdout","text":["Collecting emcee\n","  Downloading emcee-3.1.6-py2.py3-none-any.whl.metadata (3.0 kB)\n","Requirement already satisfied: numpy in /usr/local/lib/python3.11/dist-packages (from emcee) (2.0.2)\n","Downloading emcee-3.1.6-py2.py3-none-any.whl (47 kB)\n","\u001b[?25l   \u001b[90m\u001b[0m \u001b[32m0.0/47.4 kB\u001b[0m \u001b[31m?\u001b[0m eta \u001b[36m-:--:--\u001b[0m\r\u001b[2K   \u001b[90m\u001b[0m \u001b[32m47.4/47.4 kB\u001b[0m \u001b[31m1.9 MB/s\u001b[0m eta \u001b[36m0:00:00\u001b[0m\n","\u001b[?25hInstalling collected packages: emcee\n","Successfully installed emcee-3.1.6\n"]}]}]}